import React from "react";
class Class extends React.Component {
    constructor(props){
        super(props);
        this.state = {name : "Nazish"};
    }
     update = () => {
        this.setState({
           name: "Asghar"
        })
    }
    render() {
        return (
            <div>
                {this.state}
                <button onClick={this.update}>Click</button>
            </div>
        );
    }
}
export default Class;
